wp.customize.controlConstructor["kirki-multicheck"]=wp.customize.kirkiDynamicControl.extend({initKirkiControl:function(){var t=this;t.container.on("change","input",function(){var i=[],e=0;jQuery.each(t.params.choices,function(n){if(t.container.find('input[value="'+n+'"]').is(":checked")){t.container.find('input[value="'+n+'"]').parent().addClass("checked");i[e]=n;e++}else{t.container.find('input[value="'+n+'"]').parent().removeClass("checked")}});t.setting.set(i)})}});